import './index.scss'
import {Tree} from "react-tree-graph";

const About = () => {
    let data = {
        name: 'Parent',
        children: [{
            name: 'Child One'
        }, {
            name: 'Child Two'
        }]
    };

    return (
        <>
            <div className="container home-page">
                <div className="text-zone">
                    <h1>
                        <Tree
                            data={data}
                            height={400}
                            width={400}/>
                    </h1>
                </div>
            </div>
        </>
    );
}

export default About
